import React from 'react'
//import ReactDOM from "react-dom";


class home extends React.Component{
   
    render(){
        return (
          <nav class="navbar" style={{backgroundColor: "white"}}>
          <a class="navbar-brand" href="#">
              <h1 style={{color: "#000066",size: "15px;" }} >XSIS 2.0</h1>
          </a>
      </nav>
        )
    }
}

export default home
